import styled from "styled-components";

const CSS = styled.div`
  .main-box{
    color: #898996;
    display:flex;

    padding: 5%;
    margin: 5%;

    .intro-text{
      width: 40%;
      text-align: right;
      transform: perspective(700px) rotateY(-45deg);
      background: pink;
    }
    .img-chart{
      width: 60%;
      transform: perspective(700px) rotateY(-15deg);
      box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
    }
    .img-chart-background{
      width: 20%;
      position: absolute;
      float: right;
      transform: perspective(700px) rotateY(-10deg);
      box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
    }
    .img-backtest{
      width: 40%;
      box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;

    }
    box-shadow: rgba(0, 0, 0, 0.4) 0px 5px 15px;

  }

`;

export const Homepage = () => {
  return (
    <CSS>
      <div className="main-box"> 
        <tspan className="intro-text">title... sentence one</tspan>
        <img className="img-chart-background" src="logo192.png" alt=""/>
        <img className="img-chart" src="chart-img.png" alt=""/>


      </div>



      <div><tpsan>.</tpsan></div>
    </CSS>
  )
}
